import React from 'react';


type ButtonComponentType = {
    name: string;
    started: () => void;
    disabled?: boolean;
}

export const ButtonComponent = (props:ButtonComponentType) => {



    return (
        <div>
         <button  onClick={props.started}>
             {props.name}
         </button>
        </div>
    );
};
